import React, { Component } from 'react';

class Logout extends Component {
    render() {
        return (
            <div>
                <button type='submit' onClick={this.props.handleLogOut}>Logout</button>
            </div>
        );
    }
    handleLogOut = () => {
        localStorage.clear()
    }
}

export default Logout;
